export const PLUS = 'PLUS'
export const MINUS = 'MINUS'
export const TIMES = 'TIMES'
export const DIV = 'DIV'
export const AC = 'AC'
export const EQUALS = '='


interface IButtonClick { type: AC, payload: { buttonName: string }}

export function buttonClick(buttonName: any): IButtonClick {
  return {
    type: AC,
    payload: {
      buttonName
    }
  }
}




export default {
  buttonClick
}
